const axios = require('axios');


const getCityDataFromServer = (handleSuccess) => {
    fetch("https://storage.googleapis.com/realtour/cities-rt.json", {
            method: 'GET',
        }
    ).then(response => response.json()
    ).then(success => handleSuccess(success)
    ).catch(error => console.log(error))

};

const getApartmentDataFromServer = (handleSuccess) => {
    axios({
        url: "https://storage.googleapis.com/realtour/apartments-rt.json",
        method: 'GET'
    }).then(response => response.json()
    ).then(success => handleSuccess(success)
    ).catch(error => console.log(error))
};

